import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import Login from "./pages/Login";
import Dashboard from "./pages/Dashboard";
import Patients from "./pages/Patients";
import Incidents from "./pages/Incidents";
import PatientView from "./pages/PatientView";
import { AuthProvider, useAuth } from "./context/AuthContext";

const PrivateRoute = ({ children, role }) => {
  const { user } = useAuth();
  if (!user) return <Navigate to="/login" />;
  if (role && user.role !== role) return <Navigate to="/" />;
  return children;
};

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/" element={<PrivateRoute><Dashboard /></PrivateRoute>} />
          <Route path="/patients" element={<PrivateRoute role="Admin"><Patients /></PrivateRoute>} />
          <Route path="/incidents" element={<PrivateRoute role="Admin"><Incidents /></PrivateRoute>} />
          <Route path="/me" element={<PrivateRoute role="Patient"><PatientView /></PrivateRoute>} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
